	private JDialog frameAbout;
	private JButton close;
	private JLabel image_label;
	private ImageIcon label_icon;
	private BufferedImage image;
	
	public AboutDialog() {
		
		
		frameAbout = new JDialog();
		close = new JButton("Close");
		image_label = new JLabel();
		image = new BufferedImage(600, 400, BufferedImage.TYPE_BYTE_BINARY);
		
		BoxLayout layout = new BoxLayout(frameAbout.getContentPane(), BoxLayout.Y_AXIS);
		frameAbout.setLayout(layout);
		frameAbout.setSize(620, 500);
		
		try {
			image = ImageIO.read(new ByteArrayInputStream(am));
		} catch (IOException e) {
			e.printStackTrace();
		}
		
		//ok.setAlignmentX(Component.CENTER_ALIGNMENT);
		close.addActionListener(this);
		
		label_icon = new ImageIcon(image);
		image_label.setSize(600,400);
		image_label.setIcon(label_icon);
		
		frameAbout.add(image_label);
		
		frameAbout.add(close);
		
		frameAbout.pack();
		frameAbout.setLocationRelativeTo(null);
		frameAbout.setModal(true);
		frameAbout.setVisible(true);
		
		
		
	}

	public void actionPerformed(ActionEvent arg0) {
		
		frameAbout.dispose();
	}
	
	
